import style from "./findcoder.module.css"
const Btn=()=>{
    return(
        <div id={style.btnblock}>
       <div id={style.btn_wrapper}>
        <button id={style.btn_btn}>Get Started</button>
        </div>   
        </div>
    )
}
export default Btn
